(window.webpackJsonp=window.webpackJsonp||[]).push([[893],{1248:function(n,h,t){"use strict";t.r(h);var g=t(44),c=Object(g.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-1778-dung-hoang-khong-the-chet"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1778-dung-hoang-khong-the-chet"}},[n._v("#")]),n._v(" Chương 1778: Dung Hoàng không thể chết!")]),n._v(" "),t("hr"),n._v(" "),t("p",[n._v("“Chư vị, có thể hay không cho phép ta nói một câu?”"),t("br"),t("br"),n._v("Đi tới trước mặt, Trương Huyền ôm quyền mà đứng."),t("br"),t("br"),n._v("“Đây là Cổ Thánh ở giữa sự tình, ngươi tính là gì, cũng muốn chen vào nói?” Một vị Cổ Thánh hừ lạnh."),t("br"),t("br"),n._v("Đối với trước mắt vị này, hắn sớm đã có chút không kiên nhẫn được nữa."),t("br"),t("br"),n._v("Không nói ỷ vào thiên phú và kỳ ngộ, đấu giá danh ngạch cho bọn hắn, nhân cơ hội vơ vét, chỉ nói đem Dị Linh chi thần, tự thân đưa vào chủ điện, cướp đi Xuân Thu đại điển, liền tội không thể tha!"),t("br"),t("br"),n._v("Xuân Thu đại điển là Khổng sư lưu lại bảo vật, nhân tộc chấn hưng mấu chốt, hiện tại rơi vào Dị Linh tộc nhân tay, nhân tộc kết cục như thế nào, ai cũng không biết."),t("br"),t("br"),n._v("Làm ra như vậy tội nghiệt ngập trời sự tình, lại còn da mặt dày để tự sát Thần Dung Hoàng dừng tay, cũng lại không để ý tới thân phận, quát tháo phát ra."),t("br"),t("br"),n._v("Rầm!"),t("br"),t("br"),n._v("Vị này Cổ Thánh tiếng nói vừa mới kết thúc, liền thấy một đạo đao mang thẳng tắp chém xuống đến, thân thể vội vàng co rụt lại, dù vậy, vẫn như cũ bị lưỡi đao gây thương tích, cánh tay nhỏ xuống máu tươi."),t("br"),t("br"),n._v("Vội vàng nhìn lại, ngay sau đó nhìn thấy thanh niên trong tay một chuôi huyền đao, phía trên một đạo tia sáng yêu dị, phun ra nuốt vào không ngừng."),t("br"),t("br"),n._v("“Hiện tại có tư cách sao?”"),t("br"),t("br"),n._v("Trương Huyền một mặt lãnh đạm."),t("br"),t("br"),n._v("“Ngươi tự tìm cái chết!”"),t("br"),t("br"),n._v("Bị một cái Đại Thánh đánh lén bị thương, vị này Cổ Thánh tức giận sắp bùng nổ."),t("br"),t("br"),n._v("Nếu không phải là cùng Thần Dung Hoàng chiến đấu, thương thế trên người nghiêm trọng, một chuôi vừa mới đột phá Cổ Thánh chí bảo, cũng muốn tổn thương hắn, quả thực chính là nằm mơ!"),t("br"),t("br"),n._v("“Ngươi muốn nói gì?”"),t("br"),t("br"),n._v("Cũng không nghĩ tới cái tên này, như vậy vô cùng, bởi vì một cái “Tư cách” liền kích thương bản thân một vị đồng bạn, Nhan Thanh Cổ Thánh ngăn cản lại nổi giận Cổ Thánh, nhíu nhíu mày."),t("br"),t("br"),n._v("“Thần Dung Hoàng, còn không thể chết!”"),t("br"),t("br"),n._v("Trương Huyền nói."),t("br"),t("br"),n._v("“Không thể chết?” Mới vừa bị thương Cổ Thánh hàm răng cắn chặt, vung tay áo một cái: “Ngươi có biết, những năm này, được hắn trực tiếp chém giết hoặc là gián tiếp chém giết Nhân tộc cường giả, tổng cộng có bao nhiêu? Thân là danh sư, không đi vì bọn họ báo thù, lại còn muốn cho cầu mong gì khác tình, Trương Hoằng Thiên, đây là các ngươi Trương gia cùng Danh Sư đường phong cách?”"),t("br"),t("br"),n._v("Trương Hoằng Thiên cũng nhíu nhíu mày."),t("br"),t("br"),n._v("Hiển nhiên, hắn cũng đối với chính mình cái này hậu bối cử động có chút không hiểu."),t("br"),t("br"),n._v("Thần Dung Hoàng tại vị, Dị Linh tộc càng ngày càng cường đại, cùng nhân tộc chiến đấu không biết bao nhiêu tràng, tử thương vô số, đã có cơ hội chém giết, nhất định không thể bỏ qua, thứ nhất, vì chết đi tộc nhân báo thù; Thứ hai, cũng có thể loại bỏ tai hoạ ngầm, một khi thả hổ về rừng, cũng không biết có bao nhiêu người chết ở trên tay hắn."),t("br"),t("br"),n._v("Bản thân vị này vãn bối, từ trước tới nay rõ lí lẽ, hiểu đại nghĩa, làm sao thời khắc mấu chốt phạm hồ đồ rồi?"),t("br"),t("br"),n._v("“Đừng kéo Trương gia cùng Danh Sư đường, đây là riêng ta quyết định, không có quan hệ gì với bọn họ!” Trương Huyền khoát tay áo."),t("br"),t("br"),n._v("Lạc Nhược Hi mấu chốt, tại đây cái Thần Dung Hoàng trên người, như thế nào liên hệ đối phương, tìm kiếm đối phương, chỉ có thể dựa vào hắn."),t("br"),t("br"),n._v("Thật muốn chết ở chỗ này, tương đương với một đầu cuối cùng manh mối cũng đứt mất."),t("br"),t("br"),n._v("Quyết không cho phép loại chuyện này phát sinh."),t("br"),t("br"),n._v("“Người quyết định? Ngươi một cái Đại Thánh, thật cho rằng, quyết định của mình, có thể ảnh hưởng đến Cổ Thánh quyết sách?”"),t("br"),t("br"),n._v("Nhân tộc lại một vị Cổ Thánh cười nhạo: “Chỉ bằng một chuôi may mắn đột phá vũ khí? Có phần cũng quá đề cao bản thân đi!”"),t("br"),t("br"),n._v("“Chỉ bằng chuôi này đao, đương nhiên không làm được...”"),t("br"),t("br"),n._v("Hừ một tiếng, Trương Huyền nhìn quanh một vòng, trong tay huyền đao, xuất thủ lần nữa."),t("br"),n._v("Tê lạp!"),t("br"),t("br"),n._v("Vạch phá không gian cùng thời gian, trong nháy mắt, xuất hiện tại một bên còn không có rời đi Dục lão quỷ phía trước, hướng về phía nó liền bổ xuống."),t("br"),t("br"),n._v("“Sát...”"),t("br"),t("br"),n._v("Một tiếng gầm thét, Dục lão quỷ kém chút nổ tung."),t("br"),t("br"),n._v("Mẹ ngươi meo, ngươi muốn lập uy, dẫn tới người khác coi trọng, đi đánh nói ngươi người ah, bổ ta làm cái gì!"),t("br"),t("br"),n._v("Ta mẹ nó trêu ai ghẹo ai?"),t("br"),t("br"),n._v("Lòng tràn đầy buồn bực, thẳng tắp hướng một bên chạy qua."),t("br"),t("br"),n._v("Lần chiến đấu này, hắn mặc dù nguyên khí tổn hao nhiều, thực lực chỉ có trước đó 2-3%, cũng không phải một cái vừa mới đột phá Yêu Dị huyền đao có thể so sánh được."),t("br"),t("br"),n._v("Tránh thoát phong mang, đang muốn giơ tay phản kích, đột nhiên cảm thấy thân thể cứng đờ, thân thể bị một cỗ mênh mông khí tức bao phủ."),t("br"),t("br"),n._v("“Ngoan Nhân Đại Đế?”"),t("br"),t("br"),n._v("Đồng tử co rụt lại."),t("br"),t("br"),n._v("Cỗ khí tức này, tuy là không còn trước đó sát lục mùi vị, nhưng thân là Dị Linh tộc nhân, trong nháy mắt liền rõ ràng, chính là lúc trước tung hoành thiên địa, cùng Khổng sư chiến đấu Ngoan Nhân tiên tổ."),t("br"),t("br"),n._v("Vị này tại Linh tộc địa vị, cùng Khổng sư tại nhân tộc địa vị tương đương, đối hắn huyết mạch có cực mạnh cảm giác áp bách."),t("br"),t("br"),n._v("Phốc!"),t("br"),t("br"),n._v("Vụt qua công phu, Yêu Dị huyền đao bên trên đao mang đã rơi vào trong tu luyện một chỗ thiếu hụt chỗ, sắc mặt trắng nhợt, một ngụm máu tươi phun ra, bay ngược ra ngoài, mạnh mẽ ngã xuống đất."),t("br"),t("br"),n._v("“Không biết, loại thực lực này, có thể hay không có thể thay đổi quyết định của các ngươi?” Đem cái tên này kích thương, Trương Huyền vẻ mặt lãnh đạm, nói."),t("br"),t("br"),n._v("Dục lão quỷ là Cổ Thánh tam trọng tích huyết trùng sinh cảnh giới cao thủ, Yêu Dị huyền đao chẳng qua vừa mới đạt tới Cổ Thánh, tình huống bình thường, rất khó làm bị thương, có điều, mượn Ngoan Nhân áp bức, lại biết đối phương thiếu hụt cùng mệnh môn, lại thêm hắn bị thương, phản ứng không lớn bằng lúc trước, một lần phía dưới vậy mà trực tiếp thành công."),t("br"),t("br"),n._v("“Loại thực lực này, đã có tư cách làm ra quyết sách, có điều, chúng ta muốn biết lý do!”"),t("br"),t("br"),n._v("Vừa rồi Trương Huyền hoạt động mặc dù nhanh, nhưng lấy nhãn lực của hắn còn là phát hiện không đúng, rõ ràng loại trừ Yêu Dị huyền đao bên ngoài, người thanh niên này, còn có cái khác át chủ bài, hai loại cộng lại, liền Bặc Dục đều có thể kích thương, đã nói rõ, có tư cách cùng bọn hắn ngồi ngang hàng."),t("br"),t("br"),n._v("Trương Huyền nhìn qua: “Các ngươi cùng Thần Linh Hoàng, Thần Tinh Hoàng liên hợp phục kích Thần Dung Hoàng, chuyện này, ta cũng không hiểu rõ tình hình, có điều, vừa rồi Thần Linh Hoàng ta gặp, là cái hiếu chiến người, trông cậy vào hắn tuân thủ ước định, duy trì ba trăm năm yên lặng, độ khó cực lớn! Hơn nữa... Nếu như vừa rồi Dung Hoàng không có đem hắn kích thương, bọn họ có thể hay không ra tay với các ngươi?”"),t("br"),t("br"),n._v("Đám người lặng im."),t("br"),t("br"),n._v("Nói thật, nếu không phải vừa rồi Thần Dung Hoàng có át chủ bài, tùy ý Thần Linh Hoàng chém giết đối phương, chỉ sợ cái tên này thật có khả năng hủy hoại hiệp nghị, đối với mình đám người ra tay."),t("br"),t("br"),n._v("Có lẽ... Cái tên này đã sớm tính toán tốt, nhóm người mình cùng Dung Hoàng lưỡng bại câu thương, sau đó tốt ngư nhân đắc lợi."),t("br"),t("br"),n._v("Chỉ cần bọn họ những người này chết một lần, danh sư đại lục chẳng khác nào không còn sau cùng bình chướng, mặc dù Chư Tử bách gia cùng Danh Sư đường tổng bộ, còn có Cổ Thánh không có đi ra, nhưng bất luận số lượng còn là thực lực, đều đã không đủ để chống lại hai vị kia Hoàng giả."),t("br"),t("br"),n._v("“Vị này Thần Linh Hoàng, liền cùng nhau tộc nhân, đều phản bội, xé bỏ hiệp nghị, không tính là gì! Ta biết, các ngươi hẳn là cũng rõ ràng điểm ấy, nhưng cân nhắc đến, đây là đánh giết Dung Hoàng thời cơ tốt nhất, thậm chí còn có thể nhân cơ hội tan rã Dị Linh tộc nhân lòng tin, để cho bọn họ sinh ra nội loạn, tự sụp đổ...”"),t("br"),t("br"),n._v("“Nếu như vừa rồi, thật ra tay thành công, các ngươi lại không có bị thương, quả thực là chuyện tốt. Nhưng bây giờ, Dung Hoàng thật đã chết rồi, Linh Hoàng trở về thông cáo thiên hạ, nói là bị chúng ta phục kích mà chết! Bản thân cũng bởi vì muốn cứu hắn, bị nhân tộc kém chút đánh giết... Về sau người tại trong tộc uy tín, Dị Linh tộc nhân, tất nhiên sẽ đối nhân tộc, sinh ra tức giận, ngưng tụ cùng một chỗ... Những này, không cần ta nói nhiều, các ngươi cũng hẳn là có thể suy nghĩ ra đi!”"),t("br"),t("br"),n._v("Trương Huyền nói."),t("br"),t("br"),n._v("“Cái này...” Nhan Thanh Cổ Thánh nói không ra lời."),t("br"),t("br"),n._v("Quả thực, Dung Hoàng thật muốn chết ở chỗ này, Thần Linh Hoàng chỉ cần thêm chút lợi dụng, liền sẽ để toàn bộ chủng tộc cùng chung mối thù, đến lúc đó, nhân tộc chắc chắn rơi vào càng lớn nguy hiểm."),t("br"),t("br"),n._v("Người đăng: ThấtDạ"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-1789"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-1791"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=c.exports}}]);